import React, { useEffect, useState } from 'react';

function App(){

  const [movies, setMovies] = useState([]);

  useEffect(() => {
    fetch('/movies')
    .then((response) => {
      if (!response.ok) {
        throw new Error('HTTP error! ')
      }
    })
  })

}

export default App
